import React from "react";
import "./Input.css"

const Input = ({ type, name, value, onChange, placeholder, className }) => {
  return (
    <input
      type={type}
      name={name}
      value={value}
      onChange={onChange}
      placeholder={placeholder}
      className={
        className
          ? `${className}`
          : "w-[320px] h-[48px] px-4 py-2 text-base font-normal  border-2 borderColor rounded  "
      }
    />
  );
};

export default Input;
